/**
 * Enum for geodetic coordinate systems
 */
export enum GeodeticSystem {
    /**
     * World Geodetic System 1984
     */
    WGS84 = 'WGS84',
    /**
     * Latitude/Longitude (Geographic) coordinate system
     */
    LatLon = 'LatLon',
    /**
     * Universal Transverse Mercator
     */
    UTM = 'UTM',
    /**
     * None
     */
    None = 'None'
}
